import { Box, Toolbar } from "@mui/material";

const Footer = () => {
  return (
    <Box className="bg-[#304FA1]">
      <Toolbar>
        <div style={{flex: 6, border: '1px solid white'}}>hammad</div>
        <div style={{flex: 4, border: '1px solid white'}}>hammad</div>
        <div style={{flex: 5, border: '1px solid white'}}>hammad</div>
      </Toolbar>
      <Toolbar>
        <div>hammad</div>
        <div>hammad</div>
      </Toolbar>
    </Box>
  );
};

export default Footer;
